/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<svg	class="ui5-icon-root"	dir="${ifDefined(context.dir)}"	viewBox="0 0 512 512"	role="img"	focusable="false"	preserveAspectRatio="xMidYMid meet"	aria-label="${ifDefined(context.accessibleNameText)}"	xmlns="http://www.w3.org/2000/svg">${blockSVG1(context)}</svg>`; };
const block1 = (context) => { return svg`<title id="${ifDefined(context._id)}-tooltip">${ifDefined(context.accessibleNameText)}</title>	`; };

const blockSVG1 = (context) => {return svg`	${ context.hasIconTooltip ? block1(context) : undefined }<g role="presentation"><path transform="translate(0, 512) scale(1, -1)" d="${ifDefined(context.pathData)}"/></g>`};
export default block0;
